var keypad = [[1,2,3],[4,5,6],[7,8,9]];
var x = 1, y = 1, code = '';
var input = [
    "","","","",""];
function checkBounds(val){
    if(val < 0)
        return 0;
    if(val > 2)
        return 2;
    return val;
}
input.forEach(function(keyCodeLine){
    for(var step = 0; step < keyCodeLine.length; step++){
        switch (keyCodeLine.charAt(step)) {
            case 'U':
                y--;
                break;
            case 'D':
                y++;
                break;
            case 'L':
                x--;
                break;
            case 'R':
                x++;
                break;
        }
        x = checkBounds(x);
        y = checkBounds(y);
    }
    code += keypad[y][x];
});
console.log(code);